import styles from './NavBar.module.css'

import {NavLink, useNavigate} from 'react-router-dom'

//hooks
import {useAuth} from '../../hooks/useAuth'
import {useDispatch} from 'react-redux'

//redux
import {logout, reset} from '../../slices/authSlice'

const NavBar = () => {

    const {auth} = useAuth()

    const navigate = useNavigate()

    const dispatch = useDispatch()

    const handleLogout = () => {
        dispatch(logout())
        dispatch(reset())

        navigate("/")
    }

    return (
        < nav className = {
            styles.navbar
        } > {
            auth && (<> < NavLink to = '/perfil' className = {
                styles.logo
            } > Ajud<span> A + </span></NavLink></>)
        } {
            !auth && (<> < NavLink to = '/' className = {
                styles.logo
            } > Ajud<span> A + </span></NavLink></>)
        } < ul className = {
            styles.list
        } > {
            !auth
                ? (<><li> < NavLink to = '/' className = {
                    ({isActive}) => (
                        isActive
                            ? styles.active
                            : ""
                    )
                } > Inicio</NavLink></li><li> < NavLink to = '/cadastro' className = {
                    ({isActive}) => (
                        isActive
                            ? styles.active
                            : ""
                    )
                } > Cadastro</NavLink></li><li> < NavLink to = '/login' className = {
                    ({isActive}) => (
                        isActive
                            ? styles.active
                            : ""
                    )
                } > Login</NavLink></li><li> < NavLink to = '/pedidos' className = {
                    ({isActive}) => (
                        isActive
                            ? styles.active
                            : ""
                    )
                } > Pedidos</NavLink></li></>)
                : (<><li> < NavLink to = '/perfil' className = {
                    ({isActive}) => (
                        isActive
                            ? styles.active
                            : ""
                    )
                } > Inicio</NavLink></li><li> < NavLink to = '/dashboard' className = {
                    ({isActive}) => (
                        isActive
                            ? styles.active
                            : ""
                    )
                } > Meus pedidos</NavLink></li></>)
        }<li> < NavLink to = '/sobre' className = {
            ({isActive}) => (
                isActive
                    ? styles.active
                    : ""
            )
        } > Sobre</NavLink></li> {
            auth && (<><li> < button onClick = {
                handleLogout
            }
            className = 'btn_global' > Sair</button></li></>)
        }</ul></nav>
    )
}

export default NavBar
